svg.script:
var slide = 1;
document.onclick = function() {showSlide(++slide);}

function showSlide(slide) {
  for (var e of Array.from(document.getElementsByTagName('g'))) {
    var v = e.getAttribute("inkscape:label");
	if (v != null) {
	  if (parseInt(v) > slide) {
	    e.style.opacity = 0;
	  }
	  else {
	    e.style.opacity = 1;
	  }
	}
  }
}

showSlide(1);
